  const [password,setPassword]=useState('');
  return(
    <div className="body">

      <Router>
        <Switch>
          <Route exact path="/">
          <Home/>
          </Route>
          <Route path="/register">
            <Register/>
          </Route>
          <Route path="/about">
            <About/>
          </Route>
          <Route path="/event">
            <Event/>
